    setcartShow(true);
  }
  const hiddenCartHandler=()=>{
    setcartShow(false);
  }
  return (
    <Fragment>
      {cartShow && <Cart/>}
      <Header/>
      <main>
        <Meals/>
      </main>
    </Fragment>
  );
}

export default App;
